import {Component} from "react";

export default class Users extends Component{
    constructor(props){
        this.state ={
            ulist: []
        }
    }
    render(){
        let tableData = this.state.ulist.map((u)=> (
            <tr key={u.name}> 
                <td>u.name</td>
                <td>u.age</td>
            </tr>
        ));
        return (
          <table>
              <thead>
                  <th>Name</th>
                  <th>Age</th>
              </thead>
              <tbody>
                {tableData}
              </tbody>
          </table>
        )
    }
}
